import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import RealTime from './components/RealTime';
import NotFound from "/components/common/NotFound";
function App() {
  return (
    <BrowserRouter>
    <div>
      <Switch>
        <Route component={NotFound}></Route>
      </Switch>
    </div>    
    </BrowserRouter>
  );
}

export default App;
